(20995, 24012, 2329, 1, '01. 總有一天', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, '昨天我相信 今天我不確定\r\n過去所擁有的我從沒有懷疑\r\n閉上了眼睛 卻沒有痕跡\r\n\r\n你在我身邊 就好像是昨天\r\n傷心的日子彷彿天地那麼遠\r\n越過那條線 無法預知的改變\r\n\r\n總有一天你會明白\r\n沒有你我並不孤單\r\n讓彼此自由 各自生活\r\n曾有的愛不會消散\r\n沒有人能把你取代\r\n有些事只能靠自己走出來\r\nMaybe someday 你也懂了\r\n\r\n昨天我相信 今天我不確定\r\n過去所擁有的我從沒有懷疑\r\n閉上了眼睛 卻沒有痕跡\r\n\r\n\r\n* ~~~~ *\r\n你在我身邊 就好像是昨天\r\n傷心的日子彷彿天地那麼遠\r\n越過那條線 就這麼大的改變\r\n冬天的天氣 需要 更多勇氣', '', 330, '', 'Lisa', 'Lisa', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 18:27:30', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(20996, 24012, 2329, 2, '02. Oh My Little Girl', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, 'こんなにも騒がしい街并に たたずむ君は\r\nとても小さく とっても寒がりで 泣きむしな女の子さ\r\n街角のLove Song 口ずさんで ちょっぴりぼくに微笑みながら\r\n冻えた躰 そっとすりよせて 君は口づけせがむんだ\r\nOh My Little Girl 暖めてあげよう\r\nOh My Little Girl こんなにも爱してる\r\nOh My Little Girl\r\n二人黄昏に 肩寄せ歩きながら\r\nいつまでも いつまでも 离れられないでいるよ\r\n\r\n君の髪を 抚でながら ぼんやりと君を见てるよ\r\n甘えた声で 无邪気に笑う ぼくの腕に包まれた君を\r\nOh My Little Girl 素敌な君だけを\r\nOh My Little Girl こんなにも爱してる\r\nOh My Little Girl\r\n冷たい风が 二人の躰すり抜け\r\nいつまでも いつまでも 离れられなくさせるよ\r\n\r\nOh My Little Girl 暖めてあげよう\r\nOh My Little Girl こんなにも爱してる\r\nOh My Little Girl\r\n二人黄昏に 肩寄せ歩きながら\r\nいつまでも いつまでも 离れないと誓うんだ', '', 266, '', '尾崎 豊', '尾崎 豊', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 18:38:41', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(20997, 24012, 2329, 3, '03. You Light Up My Life', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, 'So many nights, I''d sit by my window,\r\nwaiting for someone to sing me his song.\r\nSo many dreams, I kept deep inside me,\r\nAlone in the dark, but now you''ve come along.\r\n\r\nAnd you light up my life;\r\nyou give me hope, to carry on.\r\nYou light up my days\r\nand fill my nights with song.\r\n\r\nRollin'' at sea adrift on the waters\r\ncould it be finally, I''m turning for home\r\nfinally a chance to say “Hey, I Love You''\r\nNever again to be all alone.\r\n\r\nAnd you light up my life;\r\nyou give me hope, to carry on.\r\nYou light up my days\r\nand fill my nights with song.\r\nYou, you light up my life\r\nyou give me hope to carry on\r\nyou light up my days\r\nand fill my nights with song\r\nit can''t be wrong, when it feels so right\r\nCause you you light up my life', '', 223, '', 'Joe Brooks', 'Joseph Brooks', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 18:45:13', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(20998, 24012, 2329, 4, '04. 漫步人生路', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, '在你身邊路雖遠未疲倦\r\n伴你漫行一段接一段\r\n越過高峰另一峰卻又見\r\n目標推遠讓理想永遠在前面\r\n\r\n路縱崎嶇亦不怕受磨練\r\n願一生中苦痛快樂也體驗\r\n愉快悲哀在身邊轉又轉\r\n風中賞雪霧裏賞花快樂迴旋\r\n\r\n毋用計較快欣賞身邊美麗每一天\r\n還願確信美景良辰在腳邊\r\n\r\n願將歡笑聲蓋掩苦痛那一面\r\n悲也好，喜也好，每天找到新發現\r\n讓疾風吹呀吹，儘管給我倆考驗\r\n小雨點，放心灑，早已決心向著前', '', 257, '', '中島美雪', '鄭國江', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 18:54:37', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(20999, 24012, 2329, 5, '06.守著陽光守著你', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, '守著陽光　守著你\r\n讓我 摯起你的手　在等待的歲月中\r\n我已經學會了不絕望\r\n守候著你　我就守候住一身的陽光\r\n\r\n夢境會成為過去　一如黑夜要躲藏\r\n我仍是那最早起的明星\r\n守著朝陽　朝陽下你燦爛的甦醒\r\n\r\n什麼樣的信約 可以等候三世　\r\n什麼樣的記憶 可以永不遺忘\r\n什麼樣的思念 可以不怕倉桑　\r\n什麼樣的日子 可以讓你不再流淚 讓我不再心傷', '', 306, '', '李壽全', '謝材俊', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 19:20:06', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(21000, 24012, 2329, 6, '05. 你著忍耐', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, '踏出社會為著將來　離開故鄉走天涯\r\n那知命運這呢壞　前途茫茫像大海\r\n無論三年亦五載　受盡風霜也忍耐\r\n心愛的心愛的你那有瞭解　請你著忍耐\r\n轉載來自 ※Mojim.com　魔鏡歌詞網\r\n女性不是無氣概　暗暗目屎吞腹內\r\n滿腹（滿腹痛苦誰人知）\r\n心酸（心酸苦情放心內）悲哀也忍耐', '', 259, '', '董家銘', '廖信富', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 19:37:31', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(21001, 24012, 2329, 7, '07. 乘著風', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, '當你想念我的時候 不要以為我不再想你\r\n當你忘記我的時候 不要以為我也忘記你\r\n無論我何在\r\n愛總是抓著你的憂愁\r\n愛總是張開你的手\r\n乘著風 乘著風\r\n在風中我想你 在風中看你\r\n乘著風 乘著風\r\n我可以靠近你的臉\r\n我可以感覺到你 乘著風\r\n\r\n當你想看我的時候 不要以為我會再回頭\r\n當你決定不跟我走的時候 不要以為我真放棄你\r\n無論你何在\r\n愛總是抓著你的憂愁\r\n愛總是張開你的手\r\n\r\n乘著風 乘著風\r\n在風中我想你 在風中看你\r\n乘著風 乘著風\r\n我可以靠近你的臉\r\n我可以感覺到你 乘著風', '', 356, '', '黃大煒', '盧昌明', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 19:48:07', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(21002, 24012, 2329, 8, '08. 追夢人', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, '讓青春吹動了你的長髮　讓它牽引你的夢\r\n不知不覺這城市的歷史已記取了妳的笑容\r\n紅紅心中藍藍的天　是個生命的開始\r\n春雨不眠　隔夜的你曾空獨眠的日子\r\n\r\n讓青春嬌豔的花朵　綻開了深藏的紅顏\r\n飛去飛來的滿天的飛絮　是幻想你的笑臉\r\n秋來春去紅塵中　誰在宿命裡安排\r\n冰雪不語寒夜的你那難隱藏的光彩\r\n\r\n看我看一眼吧　莫讓紅顏守空枕\r\n青春無悔不死　永遠的愛人\r\n\r\n讓流浪的足跡在荒漠裡寫下永久的回憶\r\n飄去飄來的筆跡是深藏的激情你的心語\r\n前塵後世輪迴中　誰在聲音裡徘徊\r\n癡情笑我凡俗的人世終難解的關懷\r\n', '', 199, '', '羅大佑', '羅大佑', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 19:56:28', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(21003, 24012, 2329, 9, '09. Love Love Love', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, 'ねぇ　どうして\r\nすっごくすごく好きなこと\r\nただ　傳えたいだけなのに\r\nルルルルル\r\nうまくいえないんだろう\r\nねぇ　せめて\r\n夢で會いたいと願う\r\n夜に限って　いちども\r\nルルルルル\r\n出てきてはくれないね\r\nねぇ　どうして\r\nすごく愛してる人に\r\n愛してるというだけで\r\nルルルルル\r\n淚が出ちゃうんだろう\r\n\r\nふたり出會った日が\r\nすこしずつ思い出になっても\r\n\r\n愛してる　愛してる\r\nねぇ　どうして\r\n淚が出ちゃうんだろう\r\n淚が出ちゃうんだろう\r\n\r\nLove Love Love　愛を叫ぼう　\r\nLove Love Love　愛を叫ぼう　', '', 245, '', '中村正人', '吉田美和', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 20:08:56', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(21004, 24012, 2329, 10, '10. 濃妝搖滾', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, '不該在這個時候想你　可是我心不順我意\r\n啊　你的影子填滿屋裡　啊　不去想你真不容易\r\n\r\n梳個漂亮時髦髮型　丟開寒冷頹喪心情\r\n啊　夜空星星都已聚集　啊　淚珠溶在汗水裡\r\n\r\n走在鬧區人潮在擁擠　無你蹤影\r\n雙雙對對是那麼熱情　唯我獨行\r\n\r\nGO DISCO DANCE　讓我躲在黑夜裡\r\n不要讓你看到我流淚　哭泣的臉\r\nGO DISCO DANCE　歡笑人潮已離去\r\n讓我們心靈飛揚　讓我們來跳ROCK''N ROLL\r\n閃亮直到生命結束也不在意　ROCK''N ROLL ', '', 289, '', '林哲司', '泥鰍', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 20:25:34', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(21005, 24012, 2329, 11, '11. Desperado', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, 'Desperado, why don''t you come to your senses\r\nYou''ve been out riding'' fences,\r\nfor so long - now.\r\nOh you''re a hard one.\r\nI know that you''ve got your reasons.\r\nThese things that are pleasin''you\r\ncan hurt you somehow.\r\n\r\nDon''t you draw the queen of diamonds boy\r\nShe''ll beat you if she''s able.\r\nYou know the queen of hearts is always your best bet.\r\nNow it seems to me, some fine things\r\nhave been laid upon your table.\r\nBut you only want the ones\r\nthat you can''t get.\r\n\r\nDesperado,\r\nOh you ant getting no younger.\r\nYour pain and your hunger,\r\nThey''re driving you home.\r\nAnd freedom oh freedom.\r\nWell that''s just some people talking.\r\nYour prison is walking through this world all alone.\r\n\r\nDon''t your feet get cold in the winter time?\r\nThe sky won''t snow and the sun won''t shine.\r\nIt''s hard to tell the night time from the day.\r\nAnd you''re losing all your highs and lows\r\nant it funny how the feeling goes\r\naway...\r\nDesperado,\r\nWhy don''t you come to your senses?\r\nCome down from your fences, open the gate.\r\nIt may be raining'', but there''s a rainbow above you.\r\nYou better let somebody love you.\r\nlet somebody love you.\r\nYou better let somebody love you... before it''s too.. late.', '', 211, '', 'Don Henlry', 'Gleen Frey', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 20:42:27', '2015-03-12 13:40:54', '0000-00-00 00:00:00'),
(21006, 24012, 2329, 12, '12. 手太小', '', '2010-01-20 00:00:00', 2000, 25, 0, 4, '給我你的手\r\n請稍息\r\n你有什麼不好　我最明瞭\r\n從不在乎　狀況越來越糟\r\n她能送 Gucci 的錶　誰會不要\r\n難道就收買 你離開我懷抱　\r\n我陷得太深　失去了分寸\r\n你良心幾分　這樣的殘忍\r\n像載滿了謊言的火車　碾過我　臥軌的靈魂\r\n我知道我的手太小　夢做得太多捧不了\r\n明知得不到　卻又放不掉\r\n自由被愛緊緊的套牢\r\n我知道我的手太小　太野的你我抓不著\r\n不願服輸　卻在你身後跌倒\r\n我的付出　你永遠看不到\r\n你有什麼不好　我最明瞭\r\n從不在乎　狀況越來越糟\r\n她能送 Gucci 的錶　誰會不要\r\n早就收買\r\n你離開我懷抱　\r\n我陷得太深　失去了分寸\r\n你良心幾分　這樣的殘忍\r\n像載滿了謊言的火車　碾過我　臥軌的靈魂\r\n我知道我的手太小　夢做得太多捧不了\r\n明知得不到　卻又放不掉\r\n自由被愛緊緊的套牢\r\n我知道我的手太小　太野的你我抓不著\r\n不願服輸　卻在你身後跌倒\r\n我的付出　你永遠看不到\r\n跟我一起好嗎?\r\n我知道我的手太小　夢做得太多捧不了\r\n明知得不到　卻又放不掉\r\n自由被愛緊緊的套牢\r\n再一個\r\n我知道我的手太小　太野的你我抓不著\r\n不願服輸　卻在你身後跌倒\r\n我的付出　你永遠不明瞭', '', 301, '', 'Shino', 'Shino Zo', '', '典選音樂事業股份有限公司', '', 1, 1, 0, '2010-01-26 20:55:14', '2015-03-12 13:40:55', '0000-00-00 00:00:00'),
